import React,{useState} from 'react';
import client from '../util/shopify-client'


const ItemList = () => {
    client.product.fetchAll().then((products) => {
        products.map((item,i) => (
            <div>
                Hello there
            </div>
        ))
    })    
}



const Store = () => {
    return(
        <div style={{
            position:"relative",
            top:"20vh"
        }}>
            <ItemList />
        </div>
    )
}

export default Store;
